import React from 'react';
import ReactDom from 'react-dom';
import Button from '@mui/material/Button';

const setList: Array<string> = ["男性","女性"];

const BtnComponent: React.FC = () => {
  return (
    <div>
      <Button variant="contained">{setList[0]}</Button>
      <Button variant="outlined">{setList[1]}</Button>
    </div>
  );
};

ReactDom.render(<BtnComponent />, document.getElementById("root") );
